import React from "react";
import style from "./Logos.module.css";
import apples from "./apple.jpg";
import samsung from "./samsung.jpg";
import xiaomi from "./shiaomi.jpg";

const Logos = () => {
  return (
    <div className={style.container}>
      <h3>Who Support Us?</h3>
      <div>
        <img src={apples} alt="logo" />
        <img src={samsung} alt="logo" />
        <img src={xiaomi} alt="logo" />
      </div>
    </div>
  );
};

export default Logos;
